import React, { FormEvent, useEffect, useState } from "react";
import { Link } from "react-router-dom";
import Header from "../../components/header/Header";
import TableShipping from "../../components/table/TableShipping";
import { useTransactionStore } from "../../store";
import {
  Container,
  ContainerForm,
  IconGreen,
} from "../../styled-components/GlobalStyles";
import ShippingImage from "../../assets/shipping.png";

function CreateShipping() {
  const transactionState = useTransactionStore((state) => state);
  const userProfileState = useTransactionStore((state) => state);

  useEffect(() => {
    transactionState.fetchUserTransactions();
    userProfileState.fetchUserProfiles();
  }, []);

  const [input, setInput] = useState({
    size_id: 0,
    category_id: 0,
    add_on_id: 0,
    address_id: 0,
  });

  const handleChange = (event: React.ChangeEvent<HTMLSelectElement>) => {};

  const handleChangeInput = (event: FormEvent<HTMLInputElement>) => {
    console.log(event.currentTarget);
    setInput({
      ...input,
      [event.currentTarget.name]: event.currentTarget.value,
    });
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();

    const ESizeId = document.getElementById("size_id") as HTMLSelectElement;
    const ECategoryId = document.getElementById(
      "category_id"
    ) as HTMLSelectElement;
    const EAddOnId = document.getElementById("add_on_id") as HTMLSelectElement;
    const EInputAddress = document.getElementById(
      "inputAddress"
    ) as HTMLInputElement;

    transactionState.postCreateShipping({
      address_id: parseInt(EInputAddress.value),
      size_id: parseInt(ESizeId.value),
      category_id: parseInt(ECategoryId.value),
      add_on_id: parseInt(EAddOnId.value),
    });
  };

  function makeid(length: number) {
    let result = "";
    let characters = "ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
    let charactersLength = characters.length;
    for (var i = 0; i < length; i++) {
      result += characters.charAt(Math.floor(Math.random() * charactersLength));
    }
    return result;
  }
  return (
    <div className="container">
      <Header />
      <Link to="/shipping">
        <button className="btn btn-success">Back</button>
      </Link>
      <div className="container">
        <div className="row justify-content-md-center">
          <div className="col"></div>
          <ContainerForm>
            <div className="md-2">
              <h2 className="d-flex justify-content-center fw-bold">
                Create New Shipping
              </h2>
              <form className="p-2">
                <div className="mb-3">
                  <label>Size</label>
                  <select
                    onChange={(e) => handleChange(e)}
                    defaultValue="1"
                    className="form-select"
                    id="size_id"
                    name="size_id"
                  >
                    <option value="1">Large</option>
                    <option value="2">Medium</option>
                    <option value="3">Small</option>
                  </select>
                </div>
                <div className="mb-3">
                  <label>Category</label>
                  <select
                    onChange={(e) => handleChange(e)}
                    defaultValue="1"
                    className="form-select"
                    id="category_id"
                    name="category_id"
                  >
                    <option value="1">Food and Beverages</option>
                    <option value="2">Fragile</option>
                  </select>
                </div>
                <div className="mb-3">
                  <label>Add On</label>
                  <select
                    onChange={(e) => handleChange(e)}
                    defaultValue="1"
                    className="form-select"
                    id="add_on_id"
                    name="add_on_id"
                  >
                    <option value="1">Safe Package</option>
                    <option value="2">Cooler</option>
                    <option value="3">Heatkeeper</option>
                  </select>
                </div>
                <div className="mb-3">
                  <label>Address ID</label>
                  <input
                    className="form-control"
                    type="number"
                    name="amount"
                    placeholder="Enter address ID"
                    id="inputAddress"
                    onChange={(event) => handleChangeInput(event)}
                  />
                </div>
              </form>
            </div>
            <div className="p-2 d-grid gap-3">
              <button
                className="btn btn-success"
                type="submit"
                data-bs-toggle="modal"
                data-bs-target="#exampleModal"
                onClick={(e) => handleSubmit(e)}
              >
                Create
              </button>
            </div>
            <div className="col xs lg-2 d-flex justify-content-end">
              <img src={ShippingImage} height="400px" alt="Shipping Image" />
            </div>
          </ContainerForm>
          <div
            className="modal fade"
            id="exampleModal"
            tabIndex={-1}
            aria-labelledby="exampleModalLabel"
            aria-hidden="true"
          >
            <div className="modal-dialog">
              <div className="modal-content">
                <div className="modal-header d-flex justify-content-center">
                  <Container>
                    <div className="d-flex justify-content-center flex-column mb-3">
                      <div className="p-2">
                        <IconGreen>
                          <i className="bi bi-check-circle-fill"></i>
                        </IconGreen>
                      </div>
                      <div className="p-2">
                        <h1
                          className="modal-title fs-5 d-flex justify-content-center text-center fw-bold"
                          id="exampleModalLabel"
                        >
                          Top Up Success
                        </h1>
                      </div>
                    </div>
                  </Container>
                </div>
                <div className="modal-body d-flex justify-content-center">
                  <div className="row">
                    <div className="col">
                      <p>Size</p>
                      <p>Category</p>
                      <p>Add On</p>
                      <p>Address</p>
                    </div>
                    <div className="col">
                      {/* <p>{transactionState.createShippingResponse.size.name}</p>
                      <p>
                        {transactionState.createShippingResponse.category.name}
                      </p>
                      <p>
                        {transactionState.createShippingResponse.add_on.name}
                      </p>
                      <p>
                        {
                          transactionState.createShippingResponse.address
                            .full_address
                        }
                      </p> */}
                    </div>
                  </div>
                </div>
                <div className="modal-footer d-flex justify-content-center">
                  <button type="button" className="btn btn-primary">
                    Print
                  </button>
                  <Link to="/shipping">
                    <button
                      type="button"
                      className="btn btn-secondary"
                      data-bs-dismiss="modal"
                    >
                      Close
                    </button>
                  </Link>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CreateShipping;
